import React from 'react';
import { Link } from 'react-router-dom';
function Home() {
  return (
<div>
<div className="content">
<div className="text-container">
    <h1>Personal Budget Tracking</h1>
    <h3>Sign In to your Dashboard to track expenses</h3>
    </div>
</div>
</div>
);
}
export default Home;
